import React from 'react';
import { SectionSocialMedia, Social, Icon, SocialDesc, Span, SpanInfo } from "./style";

import axios from "axios";

class SocialMedia extends React.Component {

    state

    render() {
        return (
            <SectionSocialMedia>

                <Social>
                    <Icon className="icon fa fa-facebook fa-lg"></Icon>
                    <SocialDesc>
                        <Span>Suivez-moi sur </Span>
                        <SpanInfo>Social Facebook</SpanInfo>
                    </SocialDesc>
                </Social>

            </SectionSocialMedia>
        );
    }
}
export default SocialMedia;
